ui_text_replacements_localised_text_phar_main_fac_sum_titles_amenmesse	As Amenmesse, your [[b]]Titles[[/b]] exchange [[img:icon_pr_gold_small]][[/img]][[b]]Gold[[/b]] for campaign and battle bonuses. You can use them to specialise in [[b]]Nubian or Kushite Units[[/b]]. In campaign, you can improve [[img:icon_pr_gold_small]][[/img]][[b]]Gold[[/b]] income and [[b]]Influence[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_amenmesse	As Amenmesse, your [[b]]Titles[[/b]] exchange [[img:icon_pr_gold_small]][[/img]][[b]]Gold[[/b]] for campaign and battle bonuses. You can use them to specialise in [[b]]Nubian or Kushite Units[[/b]]. In campaign, you can improve [[img:icon_pr_gold_small]][[/img]][[b]]Gold[[/b]] income and [[b]]Influence[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_bay	As Bay, your [[b]]Titles[[/b]] provide [[b]]Influence[[/b]] on the campaign map, bonuses to ranged [[b]]Units[[/b]] in battle and grant [[b]]Abilities[[/b]] that enable [[b]]Ambushing[[/b]], such as [[b]]Vanguard Deployment[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_bay	As Bay, your [[b]]Titles[[/b]] provide [[b]]Influence[[/b]] on the campaign map, bonuses to ranged [[b]]Units[[/b]] in battle and grant [[b]]Abilities[[/b]] that enable [[b]]Ambushing[[/b]], such as [[b]]Vanguard Deployment[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_gen	Each [[b]]Character[[/b]] is defined by their [[tooltip:phar_main_traits_tooltip]][[url:hpl_help_factions_character_panel_traits]][[b]]Traits[[/b]][[/url]][[/tooltip]], [[tooltip:phar_main_competences_tooltip]][[url:hpl_help_factions_character_panel_titles_competences]][[b]]Competencies and Titles[[/b]][[/url]][[/tooltip]]. [[b]]Traits[[/b]] are granted to [[b]]Characters[[/b]] as a result of their actions in battle and on the campaign map. A general's [[b]]Competencies[[/b]] increase with each [[b]]Rank[[/b]] gained. Specific [[b]]Titles[[/b]] are unlocked by various levels/combinations of [[b]]Competencies[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_gen	Each [[b]]Character[[/b]] is defined by their [[tooltip:phar_main_traits_tooltip]][[url:hpl_help_factions_character_panel_traits]][[b]]Traits[[/b]][[/url]][[/tooltip]], [[tooltip:phar_main_competences_tooltip]][[url:hpl_help_factions_character_panel_titles_competences]][[b]]Competencies and Titles[[/b]][[/url]][[/tooltip]]. [[b]]Traits[[/b]] are granted to [[b]]Characters[[/b]] as a result of their actions in battle and on the campaign map. A general's [[b]]Competencies[[/b]] increase with each [[b]]Rank[[/b]] gained. Specific [[b]]Titles[[/b]] are unlocked by various levels/combinations of [[b]]Competencies[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_irsu	As Irsu, your [[b]]Titles[[/b]] reduce your faction's [[b]]Happiness[[/b]] in exchange for various bonuses. Your armies can cause fear in enemy [[b]]Units[[/b]] and you gain more loot from winning battles, especially [[b]]Sieges[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_irsu	As Irsu, your [[b]]Titles[[/b]] reduce your faction's [[b]]Happiness[[/b]] in exchange for various bonuses. Your armies can cause fear in enemy [[b]]Units[[/b]] and you gain more loot from winning battles, especially [[b]]Sieges[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_kurunta	As Kurunta, your [[b]]Titles[[/b]] allow your armies to specialise in [[b]]Kaskian[[/b]] and [[b]]Phrygian Units[[/b]]. You can unlock the [[b]]Shadow Stance[[/b]] for your [[b]]Generals[[/b]] and allow them to reduce [[img:icon_public_order]][[/img]][[b]]Happiness[[/b]] in their location.	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_ramesses	As Ramesses, your selection of [[b]]Titles[[/b]] allows your [[b]]Generals[[/b]] to specialise in various types of [[b]]Units[[/b]], such as [[b]]Medjay[[/b]], [[b]]Sherden[[/b]] or [[b]]Chariots[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_ramesses	As Ramesses, your selection of [[b]]Titles[[/b]] allows your [[b]]Generals[[/b]] to specialise in various types of [[b]]Units[[/b]], such as [[b]]Medjay[[/b]], [[b]]Sherden[[/b]] or [[b]]Chariots[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_seti	As Seti, your [[b]]Titles[[/b]] favour lower-tier [[b]]Units[[/b]] and [[b]]General Bodyguards[[/b]] in battle. They also support aggression on the campaign map, preventing enemy retreat and enabling attacks from the [[b]]March Stance[[/b]].	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_suppi	As Suppiluliuma, your [[b]]Titles[[/b]] increase your armies' [[b]]Defence[[/b]] and [[b]]Replenishment[[/b]], and help you keep your [[b]]Provinces[[/b]] stable in campaign.	false
ui_text_replacements_localised_text_phar_main_fac_sum_titles_suppi	As Suppiluliuma, your [[b]]Titles[[/b]] increase your armies' [[b]]Defence[[/b]] and [[b]]Replenishment[[/b]], and help you keep your [[b]]Provinces[[/b]] stable in campaign.	false
