ui_text_replacements_localised_text_phar_main_help_pages_factions_character_panel_titles_competences_desc_1	The [[b]]Skill Points[[/b]] your general acquires as they increase in rank can be invested in three types of [[b]]Competencies[[/b]]: Presence, Fortitude, and Ardour.\\n\\n[[img:phar_main_icon_presence]][[/img]][[b]]Presence[[/b]] decreases the [[b]]Upkeep[[/b]] cost of the general's army, and give bonuses to [[b]]Melee Attack[[/b]] and [[b]]Morale[[/b]] at milestone points.\\n\\n[[img:phar_main_icon_fortitude]][[/img]][[b]]Fortitude[[/b]] increases [[b]]Replenishement[[/b]] of the general's army, and gives bonuses to [[b]]Melee Defence[[/b]] and [[b]]Fatigue Build-up[[/b]] at milestone points.\\n\\n[[img:phar_main_icon_ardour]][[/img]][[b]]Ardour[[/b]] increases [[b]]Movement[[/b]] of the general's army, and gives bonuses to [[b]]Charge[[/b]] and battle [[b]]Speed[[/b]] at milestone points.\\n\\nNote that your generals will not be able to gain maximum competency in all categories, so plan how you would like to specialize them accordingly.\\n\\nCompetencies are also used to unlock [[b]]Titles[[/b]]. Each Title has a required level of Competence to unlock. Some Titles require a combination of 2 or 3 Competencies at a given level to be unlocked.\\n\\nOnce unlocked, Titles can be assigned in the title slots at the top of the section. Titles take effect on the next turn. Generals begin with only 1 title slot unlocked, with additional slots becoming available at Rank 8, 16 and 27, for a total of 4 maximum slots.	false
