ui_text_replacements_localised_text_phar_sea_fac_sum_titles_iolaos	As Iolaos, your [[b]]Titles[[/b]] allow you to bolster the strength of your [[b]]Generals[[/b]], [[b]]Horde[[/b]] or [[b]]Settled Units[[/b]]. They allow you to focus on specific types of [[b]]Units[[/b]] and allow you both to empower your own armies and hinder the enemy's. You can use the [[b]]Follower of Isul Title[[/b]]  to terrorise any [[b]]Region[[/b]] in which you are present.\\n\\n	false
