ui_text_replacements_localised_text_phar_sea_fac_sum_titles_walwetes	As [[b]]Walwetes[[/b]], your [[b]]Titles[[/b]] can empower both your [[b]]Generals[[/b]], [[b]]Horde[[/b]], [[b]]Settled[[/b]], and [[b]]Native Units[[/b]] through [[b]]Attributes[[/b]] and [[b]]Abilities[[/b]]. Some [[b]]Titles[[/b]] provide useful [[b]]Civic[[/b]] or [[b]]Economic[[/b]] effects that are useful if you decide to settle down and conquer some lands. You will also be able to empower your [[b]]Raiding[[/b]] stance and use it to terrorize your enemies.	false
